[{"location":"connectomes/#Guide-to-Connectomes","page":"Connectomes","title":"Guide to Connectomes","text":"","category":"section"},{"location":"connectomes/","page":"Connectomes","title":"Connectomes","text":"Connectome","category":"page"},{"location":"connectomes/#Connectomes.Connectome","page":"Connectomes","title":"Connectomes.Connectome","text":"Connectome(path::String; norm=true)\n\nMain type introduced by Connectomes.jl,\n\nstruct Connectome\n    parc::DataFrame\n    graph::SimpleWeightedGraph{Int64, Float64}\n    n_matrix::Matrix{Float64}\n    l_matrix::Matrix{Float64}\nend\n\nwhere parc is the parcellation atlas, graph is a  SimpleWeightedGraph encoding a weighted Connectome, n_matrix is  the length matrix and l_matrix is the length matrix.\n\nExample\n\njulia> cpath = Connectomes.connectomepath()\n\"/Users/pavanchaggar/.julia/dev/Connectomes/assets/connectomes/Connectomes-hcp-scale1.xml\"\n\njulia> Connectomes(cpath)\n\n\n\n\n\n","category":"type"},{"location":"#Connectomes","page":"Home","title":"Connectomes","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This is the documentation for Connectomes.jl, a package made for working with human brain connectomes, simulating dynamical systems on networks and plotting various brain related images.","category":"page"}]
